import { NextApiRequest, NextApiResponse } from "next";

var cloudinary = require('cloudinary').v2


export default async (req: NextApiRequest, res: NextApiResponse) => {
    try {
        const fileStr = req.body.data;
        console.log(fileStr)
    } catch(error) {
        console.error(error)
    }
  res.status(200).json({});
};
